@ERDALAVAR kchol için çok güveniyorum. aghol ve alarko ciddi prim yaptı ama alarko'da da hala potansiyel var. Ama kchol için bu kadar baskı doğru değil. Bilanço deli geldi. aralıkta 8 FK ile 39 gördü. Bugün tekrar 8 FK'ya gelmesi demek 48 tl görmesi demek.
